import React from "react";
import Card from "../UI/Card";

const AddUser = () => {
    return (
        <Card>
            <form>
                <div className="form__control">
                    <label>Username</label>
                    <input type="text" />
                </div>
                <div className="form__control">
                    <label>Age (Years)</label>
                    <input type="number"  />
                </div>
                <div className="form__actions">
                    <button type="submit">Add User</button>
                </div>
            </form>
        </Card>
    );
}

export default AddUser;
